import * as React from "react";
import Button from "@mui/material/Button";

function App() {
  return (
    <div className="App">
      <Button variant="text" color="error">
        Text
      </Button>
      <Button variant="contained" sx={{"&:hover":{
        back
      }}}>
        Contained
      </Button>
      <Button href="google.com" color="secondary" variant="outlined">
        GOOGLE
      </Button>
    </div>
  );
}

export default App;
